import React, { Fragment } from 'react';
import AccountDetails from './AccountDetails';
import SignIn from './SignIn';

const ShowPage = () => {
    return (
      <main>
        <AccountDetails
          username='francis'
          total_games={11}
          total_wins={8}
          total_kills={32}
        />
        <SignIn/>
      </main>
    )
  }

export default ShowPage;
